import React from "react"
import ReactDOM from "react-dom"
import {Router, Route} from "react-router";

import Home from "./Home.js"

class App extends React.Component {
    render() {
        return(
            <Router>
                <Route path={"user"}/>
                <Route path={"home"} component={Home}/>
            </Router>
        );
    }
}
